import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styles from './SuperAdminReports.module.css';

const SuperAdminReports = () => {
  const [stats, setStats] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    totalResidents: 0
  });
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [userStats, setUserStats] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [showDelayed, setShowDelayed] = useState(false);

  useEffect(() => {
    // Fetch request statistics
    axios.get('http://localhost:8080/admin/dashboard/stats')
      .then(response => {
        setStats({
          totalRequests: response.data.total,
          completedRequests: response.data.completed,
          pendingRequests: response.data.pending,
          totalResidents: 0 // Will be updated in next call
        });
        
        // Fetch delayed requests
        return axios.get('http://localhost:8080/admin/dashboard/requests/delayed');
      })
      .then(response => {
        setDelayedRequests(response.data);
        
        // Fetch user statistics
        return axios.get('http://localhost:8080/users/data');
      })
      .then(response => {
        const users = response.data;
        const residents = users.filter(u => u.role === 'User').length;
        const admins = users.filter(u => u.role === 'Admin').length;
        const superAdmins = users.filter(u => u.role === 'Super Admin').length;
        
        setStats(prev => ({
          ...prev,
          totalResidents: residents
        }));
        
        setUserStats([
          { role: 'Super Admin', count: superAdmins },
          { role: 'Admin', count: admins },
          { role: 'User', count: residents }
        ]);
        
        setLoading(false);
      })
      .catch(err => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading) return <div className={styles.container}>Loading reports...</div>;
  if (error) return <div className={styles.container}>Error: {error}</div>;

  return (
    <div className={styles.container}>
      <h2>Super Admin Reports</h2>

      {/* Scenario 1: Overall request summary */}
      <div className={styles.summaryCards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{stats.totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{stats.completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{stats.pendingRequests}</p>
        </div>
        {/* Scenario 3: Resident count */}
        <div className={styles.card}>
          <h4>Total Residents</h4>
          <p>{stats.totalResidents}</p>
        </div>
      </div>

      {/* Scenario 2: Delayed requests */}
      <div className={styles.delayedSection}>
        <h3>Delayed Requests ({delayedRequests.length})</h3>
        <button 
          onClick={() => setShowDelayed(!showDelayed)} 
          className={styles.toggleButton}
        >
          {showDelayed ? 'Hide Delayed Requests' : 'Show Delayed Requests'}
        </button>
        
        {showDelayed && delayedRequests.length > 0 && (
          <table className={styles.delayedTable}>
            <thead>
              <tr>
                <th>Request ID</th>
                <th>Description</th>
                <th>Created Date</th>
                <th>Expected Completion</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {delayedRequests.map(req => (
                <tr key={req.requestId}>
                  <td>{req.requestId}</td>
                  <td>{req.description}</td>
                  <td>{req.createDate}</td>
                  <td>{req.exceptCompletionDate}</td>
                  <td>{req.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
        {showDelayed && delayedRequests.length === 0 && (
          <p>No delayed requests found</p>
        )}
      </div>

      {/* Additional user statistics */}
      <div className={styles.userStats}>
        <h3>User Statistics</h3>
        <table className={styles.userTable}>
          <thead>
            <tr>
              <th>Role</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {userStats.map((stat, index) => (
              <tr key={index}>
                <td>{stat.role}</td>
                <td>{stat.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default SuperAdminReports;
